SourceCode.Declaration:
/// <summary>
///    The <c>BudgetSourceCommonResolvedReference</c> class is used to capture the information
///    from a resolved budget source reference whose type is <c>Common</c>.
/// </summary>
public final class BudgetSourceCommonResolvedReference extends BudgetSourceResolvedReference
{
    private Common common;

}

Method.Source:
/// <summary>
/// Gets or sets the <c>>Common</c> value to be used.
/// </summary>
/// <param name = "_common">The <c>Common</c> value to set.</param>
/// <returns>The <c>Common</c> value.</returns>
public Common parmCommon(Common _common = common)
{
    common = _common;
    return common;
}

public static BudgetSourceCommonResolvedReference construct()
{
    return new BudgetSourceCommonResolvedReference();
}
